INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 0, 1, 0, 1, 1, 190804, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "カリン", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 1, 2, 0, 0, 2, 0, 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 1, 2, 0, 0, 3, 0, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 1, 2, 0, 0, 4, 0, 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", "", 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 2, 2, 0, 0, 5, 0, 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 2, 2, 0, 0, 6, 0, 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 2, 2, 0, 0, 7, 0, 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", "", 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 3, 2, 0, 0, 8, 0, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 3, 2, 0, 0, 9, 0, 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 3, 2, 0, 0, 10, 0, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 3, 2, 0, 0, 11, 0, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 3, 2, 0, 0, 12, 0, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", "", 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 4, 2, 0, 0, 13, 0, 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 4, 2, 0, 0, 14, 0, 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 4, 2, 0, 0, 15, 0, 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 4, 2, 0, 0, 16, 0, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 4, 2, 0, 0, 17, 0, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", "", 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 0, 3, 0, 2, 18, 190804, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60000, 0, 3, 0, 3, 19, 190804, 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 1, 20, 101201, 1, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", "ハツネ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 2, 21, 101201, 1, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", "ハツネ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 1, 22, 103801, 1, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", "シオリ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 2, 23, 103801, 1, "来年も、\n一緒にいられたら…\nうれしいな", "シオリ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 1, 24, 103601, 2, "あなたと一緒にいるようになって、\nもう1年ですか…", "キョウカ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 2, 25, 103601, 2, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", "キョウカ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 1, 26, 102001, 2, "おにいちゃんとあってから、\n1年たったよ～！", "ミミ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 2, 27, 102001, 2, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", "ミミ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 2, 0, 1, 28, 100401, 2, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", "ミソギ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 2, 0, 2, 29, 100401, 2, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", "ミソギ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 1, 30, 101001, 3, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", "マホ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 2, 31, 101001, 3, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", "マホ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 1, 32, 104401, 3, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", "イリヤ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 2, 33, 104401, 3, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", "イリヤ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 2, 0, 1, 34, 101701, 3, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", "カオリ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 2, 0, 2, 35, 101701, 3, "これからも、どうぞよろしく\nお願いするさ～！", "カオリ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 1, 36, 102801, 4, "あんたと出会ってからもうそんなに\nたつのね～", "サレン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 2, 37, 102801, 4, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", "サレン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 1, 38, 102501, 4, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", "スズメ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 2, 39, 102501, 4, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", "スズメ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 1, 40, 104601, 5, "振り返れば、今までいろんなことが\nあったにゃあ…", "タマキ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 2, 41, 104601, 5, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", "タマキ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 1, 42, 104801, 5, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", "ミフユ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 2, 43, 104801, 5, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", "ミフユ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 1, 44, 103201, 6, "あなたさまと出会ってもう1年…", "アキノ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 2, 45, 103201, 6, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", "アキノ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 1, 46, 103401, 6, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", "ユカリ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 2, 47, 103401, 6, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", "ユカリ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 1, 48, 107101, 7, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", "クリスティーナ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 2, 49, 107101, 7, "ともかくこれからも\n愉しませてくれよ☆", "クリスティーナ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 1, 50, 104701, 7, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", "ジュン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 2, 51, 104701, 7, "見えないから分からないって？\nそれもそうだな…", "ジュン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 1, 52, 103701, 8, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", "トモ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 2, 53, 103701, 8, "これからもよろしくね！", "トモ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 1, 54, 100501, 8, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", "マツリ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 2, 55, 100501, 8, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", "マツリ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 1, 56, 100701, 9, "オマエと会って1年なの！\n全然成仏もできなかったし、", "ミヤコ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 2, 57, 100701, 9, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", "ミヤコ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 1, 58, 103101, 9, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", "シノブ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 2, 59, 103101, 9, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", "シノブ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 1, 60, 100901, 10, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", "アンナ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 2, 61, 100901, 10, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", "アンナ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 1, 62, 101301, 10, "君と出会ってもう1年だって！\n早いねー！", "ナナカ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 2, 63, 101301, 10, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", "ナナカ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 1, 64, 105101, 11, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", "ミツキ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 2, 65, 105101, 11, "これからも、いろんなところを\n調べさせてね？", "ミツキ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 1, 66, 105601, 11, "お前さんと出会ってもう1年か\n助太刀するつもりが", "ルカ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 2, 67, 105601, 11, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", "ルカ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 2, 0, 1, 68, 102701, 11, "早いものですわね、あなた様と\nお会いして、もう1年…", "エリコ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 2, 0, 2, 69, 102701, 11, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", "エリコ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 1, 70, 102301, 12, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", "アヤネ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 2, 71, 102301, 12, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", "アヤネ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 1, 72, 104201, 12, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", "チカ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 2, 73, 104201, 12, "私のことを見守ってください\nできることなら、ずっと…", "チカ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 2, 0, 1, 74, 102101, 12, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", "クルミ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 2, 0, 2, 75, 102101, 12, "で、でもこれからもずっと…\n一緒にいたいなぁ…", "クルミ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 1, 76, 104901, 13, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", "シズル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 2, 77, 104901, 13, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", "シズル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 1, 78, 101101, 13, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", "リノ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 2, 79, 101101, 13, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", "リノ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 1, 80, 100201, 14, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", "ユイ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 2, 81, 100201, 14, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", "ユイ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 1, 82, 100101, 14, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", "ヒヨリ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 2, 83, 100101, 14, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", "ヒヨリ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 2, 0, 1, 84, 100301, 14, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", "レイ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 2, 0, 2, 85, 100301, 14, "キミに背中を預けられる日が、\n早くきますように", "レイ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 1, 86, 105801, 15, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 0, 0, 2, 87, 105801, 15, "これからもずっと、覚えていて\nくださいね！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 1, 88, 105901, 15, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 1, 0, 2, 89, 105901, 15, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 2, 0, 1, 90, 106001, 15, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80001, 0, 2, 0, 2, 91, 106001, 15, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 0, 1, 0, 1, 92, 112101, 0, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", "スズメ", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 1, 2, 0, 0, 93, 0, 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 1, 2, 0, 0, 94, 0, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 1, 2, 0, 0, 95, 0, 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 1, 2, 0, 0, 96, 0, 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 1, 2, 0, 0, 97, 0, 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", "", 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 2, 2, 0, 0, 98, 0, 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 2, 2, 0, 0, 99, 0, 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 2, 2, 0, 0, 100, 0, 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 2, 2, 0, 0, 101, 0, 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 2, 2, 0, 0, 102, 0, 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", "", 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 3, 2, 0, 0, 103, 0, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 3, 2, 0, 0, 104, 0, 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 3, 2, 0, 0, 105, 0, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 3, 2, 0, 0, 106, 0, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 3, 2, 0, 0, 107, 0, 0, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 3, 2, 0, 0, 108, 0, 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 3, 2, 0, 0, 109, 0, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", "", 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 4, 2, 0, 0, 110, 0, 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 4, 2, 0, 0, 111, 0, 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 4, 2, 0, 0, 112, 0, 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 4, 2, 0, 0, 113, 0, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 4, 2, 0, 0, 114, 0, 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 4, 2, 0, 0, 115, 0, 0, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 4, 2, 0, 0, 116, 0, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", "", 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 0, 3, 0, 2, 117, 112101, 0, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", "スズメ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60001, 0, 3, 0, 3, 118, 112101, 7, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", "スズメ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 1, 119, 105801, 1, "ヒューヒュー♪\nドンドンパフパフー♪", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 1, 120, 105901, 1, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 2, 121, 105901, 1, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 1, 122, 106001, 1, "え？　ちょっと\nいきなりなにっ？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 2, 123, 106001, 1, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 2, 124, 105801, 1, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 3, 125, 105801, 1, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 3, 126, 105901, 1, "ですからその日に向けて\n今から気分を盛り上げているのです", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 3, 127, 106001, 1, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 4, 128, 105901, 1, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 4, 129, 105801, 1, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 4, 130, 106001, 1, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 5, 131, 105901, 1, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 5, 132, 106001, 2, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 1, 133, 190801, 2, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 6, 134, 106001, 2, "げっ…カリンじゃない\nなんでもないわよ！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 2, 135, 190801, 2, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 7, 136, 106001, 2, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 3, 137, 190801, 2, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 8, 138, 106001, 2, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 9, 139, 106001, 2, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 4, 140, 190801, 2, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 10, 141, 106001, 2, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 5, 142, 190801, 2, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 11, 143, 106001, 2, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 6, 144, 105901, 3, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 5, 145, 105801, 3, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 7, 146, 105901, 3, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 8, 147, 105901, 3, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 6, 148, 105801, 3, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 7, 149, 105801, 3, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 9, 150, 105901, 3, "あとは、牧場に素敵な温泉が\n出来たとか…", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 8, 151, 105801, 3, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 10, 152, 105901, 3, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 9, 153, 105801, 3, "えへへ、ありがとうございます\nコッコロちゃん！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 11, 154, 105901, 3, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 10, 155, 105801, 3, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 11, 156, 105801, 4, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 12, 157, 106001, 4, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 12, 158, 105801, 4, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 13, 159, 106001, 4, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 13, 160, 105801, 4, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 14, 161, 106001, 4, "…積極的？\nなんの話よ？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 14, 162, 105801, 4, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 15, 163, 105801, 4, "ムーサの町で\nきゃるきゃる～ん☆　って！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 15, 164, 106001, 4, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 16, 165, 105801, 4, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 16, 166, 106001, 4, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 17, 167, 106001, 4, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 18, 168, 106001, 5, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 12, 169, 105901, 5, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 19, 170, 106001, 5, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 13, 171, 105901, 5, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 20, 172, 106001, 5, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 14, 173, 105901, 5, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 21, 174, 106001, 5, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 15, 175, 105901, 5, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 22, 176, 106001, 5, "かくし芸？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 16, 177, 105901, 5, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 23, 178, 106001, 5, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 17, 179, 105801, 6, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 24, 180, 106001, 6, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 17, 181, 105901, 6, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 18, 182, 105801, 6, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 25, 183, 106001, 6, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 18, 184, 105901, 6, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 26, 185, 106001, 6, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 27, 186, 106001, 6, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 28, 187, 106001, 6, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 19, 188, 105801, 6, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 19, 189, 105901, 6, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 29, 190, 106001, 6, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 30, 191, 106001, 7, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 31, 192, 106001, 7, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 32, 193, 106001, 7, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 33, 194, 106001, 7, "あー\nあー\n…声、これで大丈夫かしら？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 34, 195, 106001, 7, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 35, 196, 106001, 7, "オイッスー☆", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 36, 197, 106001, 7, "……\nいや、ないわ\nいつもどおりが一番ね、うん", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 37, 198, 106001, 7, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 38, 199, 106001, 7, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 20, 200, 105901, 8, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 21, 201, 105901, 8, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 22, 202, 105901, 8, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 23, 203, 105901, 8, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 24, 204, 105901, 8, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 25, 205, 105901, 8, "オイッスー☆", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 26, 206, 105901, 8, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 27, 207, 105901, 8, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 28, 208, 105901, 8, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 20, 209, 105801, 9, "オイッスー☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 21, 210, 105801, 9, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 22, 211, 105801, 9, "あと６日で2.5周年ですか…", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 23, 212, 105801, 9, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 24, 213, 105801, 9, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 25, 214, 105801, 9, "オイッスー☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 26, 215, 105801, 9, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 27, 216, 105801, 9, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 28, 217, 105801, 9, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 29, 218, 105801, 9, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 30, 219, 105801, 9, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 31, 220, 105801, 10, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 29, 221, 105901, 10, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 32, 222, 105801, 10, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 39, 223, 106001, 10, "…………", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 30, 224, 105901, 10, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 40, 225, 106001, 10, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 33, 226, 105801, 10, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 41, 227, 106001, 10, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 34, 228, 105801, 10, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 35, 229, 105801, 10, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 42, 230, 106001, 10, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 31, 231, 105901, 10, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 43, 232, 106001, 10, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 36, 233, 105801, 10, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 6, 234, 190801, 11, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 7, 235, 190801, 11, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 8, 236, 190801, 11, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 9, 237, 190801, 11, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 10, 238, 190801, 11, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 11, 239, 190801, 11, "次にコッコロさんですが\nこちらは発声練習をしています", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 12, 240, 190801, 11, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 13, 241, 190801, 11, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 14, 242, 190801, 11, "あれ？\nもしかして緊張で気を失って…？", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 15, 243, 190801, 11, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 16, 244, 190801, 11, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 17, 245, 190801, 11, "それでは\nまた明日お会いしましょう♪", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 44, 246, 106001, 12, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 37, 247, 105801, 12, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 32, 248, 105901, 12, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 45, 249, 106001, 12, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 38, 250, 105801, 12, "ひどいですよぉキャルちゃ～ん！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 33, 251, 105901, 12, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 39, 252, 105801, 12, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 46, 253, 106001, 12, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 34, 254, 105901, 12, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 40, 255, 105801, 12, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 41, 256, 105801, 13, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 47, 257, 106001, 13, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 42, 258, 105801, 13, "忘れてきちゃいました☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 48, 259, 106001, 13, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 35, 260, 105901, 13, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 49, 261, 106001, 13, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 43, 262, 105801, 13, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 50, 263, 106001, 13, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 36, 264, 105901, 13, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 51, 265, 106001, 13, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 37, 266, 105901, 13, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 52, 267, 106001, 13, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 44, 268, 105801, 13, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 38, 269, 105901, 13, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 45, 270, 105801, 13, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 53, 271, 106001, 13, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 46, 272, 105801, 13, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 18, 273, 190801, 14, "こんにちは\n【ギルド管理協会】のカリンです", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 19, 274, 190801, 14, "昨日の生放送は\nいかがだったでしょうか？", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 20, 275, 190801, 14, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 21, 276, 190801, 14, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 22, 277, 190801, 14, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 23, 278, 190801, 14, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 24, 279, 190801, 14, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 25, 280, 190801, 14, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 26, 281, 190801, 14, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 27, 282, 190801, 14, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 47, 283, 105801, 15, "準備はいいですかっ？\n…いっきますよー！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 54, 284, 106001, 15, "祝！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 39, 285, 105901, 15, "2.5周年！", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 48, 286, 105801, 15, "おめでとうございま～す☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 55, 287, 106001, 15, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 40, 288, 105901, 15, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 49, 289, 105801, 15, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 56, 290, 106001, 15, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 41, 291, 105901, 15, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 57, 292, 106001, 15, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 50, 293, 105801, 15, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 58, 294, 106001, 15, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 51, 295, 105801, 15, "記念日だから\n平気平気♪\nやばいですね☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 59, 296, 106001, 15, "意味分かんないわよ！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 42, 297, 105901, 15, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 43, 298, 105901, 15, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 52, 299, 105801, 15, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 2, 0, 60, 300, 106001, 15, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 1, 0, 44, 301, 105901, 15, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80003, 0, 0, 0, 53, 302, 105801, 15, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("105901,45,106001,61", 80003, 0, 0, 1, 54, 303, 105801, 15, "2.5周年\nありがとうございます！", "ペコリーヌ・コッコロ・キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 0, 1, 0, 1, 304, 190804, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "カリン", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 1, 2, 0, 0, 305, 0, 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 1, 2, 0, 0, 306, 0, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 1, 2, 0, 0, 307, 0, 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 1, 2, 0, 0, 308, 0, 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 1, 2, 0, 0, 309, 0, 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", "", 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 2, 2, 0, 0, 310, 0, 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 2, 2, 0, 0, 311, 0, 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 2, 2, 0, 0, 312, 0, 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 2, 2, 0, 0, 313, 0, 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 2, 2, 0, 0, 314, 0, 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", "", 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 3, 2, 0, 0, 315, 0, 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 3, 2, 0, 0, 316, 0, 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 3, 2, 0, 0, 317, 0, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 3, 2, 0, 0, 318, 0, 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 3, 2, 0, 0, 319, 0, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 3, 2, 0, 0, 320, 0, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 3, 2, 0, 0, 321, 0, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", "", 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 4, 2, 0, 0, 322, 0, 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 4, 2, 0, 0, 323, 0, 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 4, 2, 0, 0, 324, 0, 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 4, 2, 0, 0, 325, 0, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 4, 2, 0, 0, 326, 0, 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 4, 2, 0, 0, 327, 0, 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 4, 2, 0, 0, 328, 0, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", "", 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 0, 3, 0, 2, 329, 190804, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60002, 0, 3, 0, 3, 330, 190804, 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 4, 0, 1, 331, 105901, 1, "ささ、シェフィさまはこちらへ…", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 1, 332, 106401, 1, "コッコロさん、どこへ行くの…？\n…え？", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 1, 333, 105801, 1, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 4, 0, 2, 334, 105901, 1, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 2, 335, 106401, 1, "ええと…\n二人とも何をしているの？", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 1, 336, 106001, 1, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 3, 337, 106401, 1, "あの日…？", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 2, 338, 105801, 1, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 3, 339, 105801, 1, "『プリンセスコネクト！\nRe:Dive』3.5周年！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 1, 340, 190801, 1, "やばいですね☆", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 2, 341, 106001, 1, "って、なにしれっと\n参加してんのよカリン！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 2, 342, 190801, 1, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 3, 343, 190801, 1, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 4, 344, 105801, 1, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 4, 345, 106401, 1, "えっ！？　ええとええと…！\nあ、あと14日…！", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 5, 346, 105801, 2, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 3, 347, 105901, 2, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 4, 348, 105901, 2, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 6, 349, 105801, 2, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 5, 350, 105901, 2, "さすがでございます\nペコリーヌさま", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 3, 351, 106001, 2, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 5, 352, 106401, 2, "しゃなり、しゃなり…\nふふ、案外できるものね", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 7, 353, 105801, 2, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 6, 354, 105901, 2, "さ、次はキャルさまの\n番でございますよ", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 4, 355, 106001, 2, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 6, 356, 106401, 2, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 5, 357, 106001, 2, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 6, 358, 106001, 2, "いたたた…もぉお～！\nなんであたしがこんな目に～！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 7, 359, 105901, 2, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 7, 360, 106001, 2, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 8, 361, 105901, 3, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 8, 362, 105801, 3, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 9, 363, 105901, 3, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 7, 364, 106401, 3, "聖学祭…って、なにかしら？", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 10, 365, 105901, 3, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 8, 366, 106001, 3, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 9, 367, 106001, 3, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 9, 368, 105801, 3, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 10, 369, 106001, 3, "いや、そのまんますぎでしょ…", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 8, 370, 106401, 3, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 10, 371, 105801, 3, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 9, 372, 106401, 3, "えっ？　ええ…\nぎゅーっ…？", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 11, 373, 106001, 4, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 10, 374, 106401, 4, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 12, 375, 106001, 4, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 11, 376, 105901, 4, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 13, 377, 106001, 4, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 11, 378, 105801, 4, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 14, 379, 106001, 4, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 15, 380, 106001, 4, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 11, 381, 106401, 4, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 12, 382, 105801, 4, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 12, 383, 105901, 4, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 16, 384, 106001, 4, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 12, 385, 106401, 4, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 13, 386, 105801, 5, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 14, 387, 105801, 5, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 15, 388, 105801, 5, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 17, 389, 106001, 5, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 18, 390, 106001, 5, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 13, 391, 106401, 5, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 13, 392, 105901, 5, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 16, 393, 105801, 5, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 19, 394, 106001, 5, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 17, 395, 105801, 5, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 18, 396, 105801, 5, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 19, 397, 105801, 5, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 4, 398, 190801, 6, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 5, 399, 190801, 6, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 20, 400, 106001, 6, "…えっ！？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 20, 401, 105801, 6, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 14, 402, 106401, 6, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 4, 0, 14, 403, 105901, 6, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 15, 404, 106401, 6, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 21, 405, 106001, 6, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 21, 406, 105801, 6, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 22, 407, 106001, 6, "ぶっ殺すぞ！？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 6, 408, 190801, 6, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 15, 409, 105901, 7, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 23, 410, 106001, 7, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 16, 411, 106401, 7, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 22, 412, 105801, 7, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 24, 413, 106001, 7, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 17, 414, 106401, 7, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 16, 415, 105901, 7, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 18, 416, 106401, 7, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 17, 417, 105901, 7, "もちろんでございます\n仲良くお勉強いたしましょう", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 25, 418, 106001, 7, "しれっと教育ママが\n生まれてる…？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 23, 419, 105801, 7, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 26, 420, 106001, 7, "え～～～～！？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 27, 421, 106001, 8, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 19, 422, 106401, 8, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 18, 423, 105901, 8, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 24, 424, 105801, 8, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 20, 425, 106401, 8, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 28, 426, 106001, 8, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 19, 427, 105901, 8, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 21, 428, 106401, 8, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 29, 429, 106001, 8, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 30, 430, 106001, 8, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 25, 431, 105801, 8, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 31, 432, 106001, 8, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 22, 433, 106401, 9, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 23, 434, 106401, 9, "…えっ？\n生放送の意気込み！？\n突然なに！？", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 24, 435, 106401, 9, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 25, 436, 106401, 9, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 26, 437, 106401, 9, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 27, 438, 106401, 9, "それから、それから…！\nぅ、ぅぅっ…！", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 28, 439, 106401, 9, "―びえぇぇ～んっ！！！", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 20, 440, 105901, 9, "どうされましたか、シェフィさま", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 29, 441, 106401, 9, "ううっ…ひっく…\nママッ…！", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 21, 442, 105901, 9, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 22, 443, 105901, 9, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 30, 444, 106401, 9, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 23, 445, 105901, 10, "主さま\n3.5周年まであと５日\nでございます", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 24, 446, 105901, 10, "ですがその前に\n生放送がありますね", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 25, 447, 105901, 10, "…生放送に向けた\n意気込みでございますか？", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 26, 448, 105901, 10, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 27, 449, 105901, 10, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 28, 450, 105901, 10, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 29, 451, 105901, 10, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 30, 452, 105901, 10, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 31, 453, 105901, 10, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 26, 454, 105801, 11, "3.5周年まであと４日！\nやばいですね☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 32, 455, 106001, 11, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 27, 456, 105801, 11, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 28, 457, 105801, 11, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 29, 458, 105801, 11, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 33, 459, 106001, 11, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 30, 460, 105801, 11, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 31, 461, 105801, 11, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 32, 462, 105801, 11, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 34, 463, 106001, 11, "だからあたしはやるなんて一言も…", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 33, 464, 105801, 11, "オイッスー☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 35, 465, 106001, 11, "聞きなさいっての！！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 31, 466, 106401, 12, "3.5周年まであと３日…\nそして生放送は、明日…", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 32, 467, 106401, 12, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 33, 468, 106401, 12, "おいっす！\n…こうじゃなかったわね\nええと確か…", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 34, 469, 106401, 12, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 35, 470, 106401, 12, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 34, 471, 105801, 12, "やってますねシェフィちゃん！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 36, 472, 106001, 12, "なによ、考えることは\nみんな同じってこと？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 32, 473, 105901, 12, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 36, 474, 106401, 12, "みんな…もちろんよ！", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 35, 475, 105801, 12, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 7, 476, 190801, 13, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 8, 477, 190801, 13, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 36, 478, 105801, 13, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 9, 479, 190801, 13, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 4, 0, 33, 480, 105901, 13, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 10, 481, 190801, 13, "さすが【美食殿】のママですね！\nそしてキャルさんは…", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 37, 482, 106001, 13, "大丈夫…大丈夫…\nあたしは大丈夫…", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 11, 483, 190801, 13, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 37, 484, 106401, 13, "あうー？", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("105901,34,106001,38,190801,12", 80005, 0, 4, 1, 37, 485, 105801, 13, "あ…", "みんな", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 39, 486, 106001, 13, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 4, 0, 35, 487, 105901, 13, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 38, 488, 105801, 13, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 13, 489, 190801, 13, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 38, 490, 106401, 14, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 39, 491, 105801, 14, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 40, 492, 106001, 14, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 36, 493, 105901, 14, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 39, 494, 106401, 14, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 40, 495, 105801, 14, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 37, 496, 105901, 14, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 41, 497, 106001, 14, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 40, 498, 106401, 14, "へ、へぇ…", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 41, 499, 105801, 14, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 41, 500, 106401, 14, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 42, 501, 106401, 14, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 42, 502, 105801, 15, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 42, 503, 106001, 15, "祝！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 4, 0, 38, 504, 105901, 15, "3.5周年！", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 43, 505, 106401, 15, "おめでとうございます！", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 14, 506, 190801, 15, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 2, 0, 15, 507, 190801, 15, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", "カリン", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 43, 508, 105801, 15, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 44, 509, 105801, 15, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 43, 510, 106001, 15, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 1, 0, 44, 511, 106001, 15, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", "キャル", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 44, 512, 106401, 15, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 0, 0, 45, 513, 106401, 15, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", "シェフィ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 4, 0, 39, 514, 105901, 15, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 4, 0, 40, 515, 105901, 15, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 4, 0, 41, 516, 105901, 15, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", "コッコロ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 80005, 0, 3, 0, 45, 517, 105801, 15, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", "ペコリーヌ", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("105901,42,106001,45,106401,46,190801,16", 80005, 0, 4, 1, 46, 518, 105801, 15, "これからも\nよろしくおねがいします！", "みんな", 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60003, 0, 1, 0, 1, 519, 190804, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "カリン", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60003, 1, 2, 0, 0, 520, 0, 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60003, 1, 2, 0, 0, 521, 0, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60003, 1, 2, 0, 0, 522, 0, 0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60003, 1, 2, 0, 0, 523, 0, 0, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60003, 1, 2, 0, 0, 524, 0, 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", "", 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60003, 2, 2, 0, 0, 525, 0, 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60003, 2, 2, 0, 0, 526, 0, 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60003, 2, 2, 0, 0, 527, 0, 0, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60003, 2, 2, 0, 0, 528, 0, 0, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60003, 2, 2, 0, 0, 529, 0, 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", "", 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60003, 3, 2, 0, 0, 530, 0, 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60003, 3, 2, 0, 0, 531, 0, 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60003, 3, 2, 0, 0, 532, 0, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60003, 3, 2, 0, 0, 533, 0, 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60003, 3, 2, 0, 0, 534, 0, 0, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", "", 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 60003, 3, 2, 0, 0, 535, 0, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "", 1);
